window.bookSummaryJSON = "<p>She captivates me the second I lay eyes on her. </p> <p>Everything about her is pure, delicate beauty, and in my world, those things are commodities. </p> <p>Even Aoife can be bought and sold. Even Aoife has secrets that will see her getting into bed with the Irish Mob to protect them.</p> <p>The truth won't set her free; it will entangle her deeper in my web. </p> <p>Exactly where I want her. </p> <p>One taste was all it took. </p> <p>She's mine. </p> <p>Whether she likes it or not...</p> <p>This is Finn O'Grady's story.</p>"; 
